	public static int findMaxConsecutiveOnes(int[] nums) {
        int count=0;
        int sum=0;
		for(int i=0;i<nums.length;i++){
			if(nums[i]==1){
				count++;
			}else{
				if(sum<count){
					sum=count;
					
				}
				count=0;
			}
		}
		
		if(sum<count){
			sum=count;
		}
		
		return sum;
    }

